    false,nt"url": null,nt"notes": "This outlines the results of a 32 year
    nesting study of the Red-shouldered Hawk in central Maryland that adds 31 years
    of observations to an earlier long-term study. Regression analysis indicated that
    from 1975-2002 the number of nesting pairs in the study area decreased by at least
    78%. An estimate of the population change based on the number of successful nests
    (fledging at least one young) indicated a decrease of about 88%.",nt"license_title":
